import {useParams} from "react-router-dom";
import axios from"axios";


const Todo =()=>{

    const {id}=useParams();

	const [todosdetails,setTodosdetails] = useState();





	        useEffect(()=>{


			 axios.get(`https://jsonplaceholder.typicode.com/todos/${id}`).then((res)=>{

						                        const responseTodosdetails=res.data;
						                        setTodosdetails(responseTodosdetails);



						                });







		},[]);

return( 

	<React.Fragment>



	<h1> To do number {id}</h1>



	</React.Fragment>
);


}


export default Todo;
